DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `consultar_materias_no_tomadas` (IN `alumno_id` INT)   BEGIN
    SELECT m.id_materia, m.name_materia -- Aquí agregué el id_materia
    FROM materias m
    WHERE m.id_materia NOT IN (
        SELECT c.id_materia
        FROM calificacion_observaciones c
        JOIN usuarios u ON c.id_maestro = u.id_user
        WHERE u.id_user = alumno_id -- Aquí usé el parámetro alumno_id
    );
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerInfoAlumnosPorMaestro` (IN `id_maestro_param` INT)   BEGIN
    SELECT
        m.name_materia,
        a.id_user AS id_alumno,
        a.nombre AS nombre_alumno,
        a.apellido AS apellido_alumno,
        co.calificacion,
        co.observaciones
    FROM
        materias m
    LEFT JOIN
        usuarios u ON m.id_materia = u.maestro AND u.id_rol = 2
    LEFT JOIN
        calificacion_observaciones co ON m.id_materia = co.id_materia
    LEFT JOIN
        usuarios a ON co.id_maestro = a.id_user AND a.id_rol = 3
    WHERE
        (u.id_rol = 2 OR u.id_rol IS NULL)
        AND u.id_user = id_maestro_param
    GROUP BY
        m.name_materia, u.id_user, u.nombre, u.apellido, a.id_user, a.nombre, a.apellido, co.calificacion, co.observaciones;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerInformacionMaterias` ()   BEGIN
    SELECT
        m.name_materia,
        u.id_user AS id_maestro,
        u.nombre AS nombre_maestro,
        u.apellido AS apellido_maestro,
        COUNT(DISTINCT co.id_maestro) AS cantidad_alumnos
    FROM
        materias m
    LEFT JOIN
        usuarios u ON m.id_materia = u.maestro AND u.id_rol = 2
    LEFT JOIN
        calificacion_observaciones co ON m.id_materia = co.id_materia
    WHERE
        u.id_rol = 2 OR u.id_rol IS NULL
    GROUP BY
        m.name_materia, u.id_user, u.nombre, u.apellido;
END$$

